import NavBar from "./component/main_navbar/main_nav";
import About from "./component/about/about";
import Footer from "./component/Footer/footer";
import { Routes, Route } from "react-router-dom"
function App() {
  return (
    <>
      <Routes>
      <NavBar />
          <Route path="/about">
            <About />
          </Route>
      <Footer />
    </Routes>
    </>
  );
}

export default App;
